import React, { Component } from "react";
import Filterbox from "./components/Filterbox/Filterbox.component";
import AllListings from "./components/AllListings/AllListings.component";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      listings: [],
      activeFilters: "",
    };
  }

  componentDidMount() {
    const axios = require("axios");

    axios
      .get("../public/data/data.json")
      .then((response) => response.json())
      .then((resp) => {
        console.log(resp);
      });
  }

  render() {
    return (
      <div className='App'>
        <header className='App-header'>
          <h1>Static Job Listings Site</h1>
        </header>
        <main className='App-main'>
          <Filterbox />
          <AllListings />
          <p>{this.state.listings}</p>
        </main>
      </div>
    );
  }
}

export default App;
